import React from "react";
import Listener from 'keypress.js';

const KeyPress = (props) => {
    const handleA = () => {
        console.log('ASHUTOSH A PRESSED');
        Listener.Listener("shift g", () => {
            console.log('SUCCESSFUL')
        })
    }
    return (
        <h1 onClick={handleA}>
            {props.title}
        </h1>
    )
}

export default KeyPress;
